INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Francis Ford Coppola', '1939-04-07', 'Detroit, Michigan, USA', 'nm0000338', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTM5NDU3OTgyNV5BMl5BanBnXkFtZTcwMzQxODA0NA@@._V1_.jpg', 'Francis Ford Coppola was born in 1939 in Detroit, Michigan, but grew up in a New York suburb in a creative, supportive Italian-American family. His father, Carmine Coppola, was a composer and musician. His mother, Italia Coppola (née Pennino), had been an actress.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Mario Puzo', '1920-10-15', 'Manhattan, New York City, New York, USA', 'nm0701374', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjE1NjkxMDE3NV5BMl5BanBnXkFtZTcwNjI0MDMyOA@@._V1_.jpg', 'Mario Puzo was born October 15, 1920, in "Hell\'s Kitchen" on Manhattan\'s (NY) West Side and, following military service in World War II, attended New York\'s New School for Social Research and Columbia University. His best-known novel, "The Godfather," was preceded by two critically acclaimed novels, "The Dark Arena" and "The Fortunate Pilgrim.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Al Pacino', '1940-04-25', 'Manhattan, New York City, New York, USA', 'nm0000199', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQzMzg1ODAyNl5BMl5BanBnXkFtZTYwMjAxODQ1._V1_.jpg', 'One of the greatest actors in all of film history, Al Pacino established himself during one of film\'s greatest decades, the 1970s, and has become an enduring and iconic figure in the world of American movies.Pacino was born on April 25, 1940, in the Bronx, New York, to an Italian-American family.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Robert Duvall', '1931-01-05', 'San Diego, California, USA', 'nm0000380', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjk1MjA2Mjc2MF5BMl5BanBnXkFtZTcwOTE4MTUwMg@@._V1_.jpg', 'Veteran actor and director Robert Selden Duvall was born on January 5, 1931, in San Diego, CA, to Mildred Virginia (Hart), an amateur actress, and William Howard Duvall, a career military officer who later became an admiral. Duvall majored in drama at Principia College (Elsah, IL), then served a two-year hitch in the army after graduating in 1953.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Diane Keaton', '1946-01-05', 'Los Angeles, California, USA', 'nm0000473', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNjU5NjMwOTk2NV5BMl5BanBnXkFtZTYwODg1NzY0._V1_.jpg', 'Diane Keaton was born Diane Hall in Los Angeles, California, to Dorothy Deanne (Keaton), an amateur photographer, and John Newton Ignatius "Jack" Hall, a civil engineer and real estate broker. Her ancestry includes Irish, English, German, and Scottish.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Robert De Niro', '1943-08-17', 'New York City, New York, USA', 'nm0000134', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjAwNDU3MzcyOV5BMl5BanBnXkFtZTcwMjc0MTIxMw@@._V1_.jpg', 'Robert De Niro, thought of as one of the greatest actors of all time, was born in Greenwich Village, Manhattan, New York City, to artists Virginia (Admiral) and Robert De Niro Sr. His paternal grandfather was of Italian descent, and his other ancestry is Irish, German, Dutch, English, and French.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('John Cazale', '1935-08-12', 'Boston, Massachusetts, USA', 'nm0001030', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTUzMTM1MjI5NV5BMl5BanBnXkFtZTcwMTM5NTM1Mw@@._V1_.jpg', 'John Cazale was born in Boston, Massachusetts, to an Irish-American mother, Cecilia (Holland), and an Italian-American father, John Cazale. Cazale only made five feature films in his career, all which many fans and critics alike call classics. But before his film debut, the short "The American Way", he won numerous Obie Awards for his stage performances in "The Indian Wants the Bronx" and "The Line".');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Talia Shire', '1946-04-25', 'Lake Success, Long Island, New York, USA', 'nm0001735', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTkwMzc0NjQzNV5BMl5BanBnXkFtZTYwNzM0NTk3._V1_.jpg', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Lee Strasberg', '1901-11-17', 'Budzanów, Galicia, Austria-Hungary [now Budaniv, Ukraine]', 'nm0833448', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTkzNDM2OTA4N15BMl5BanBnXkFtZTcwMDg2MzY2OQ@@._V1_.jpg', 'Famed acting teacher Lee Strassberg was born in Budzanov, Austria-Hungary (now Budanov, Ukraine). Brought to America as a child, he had a brief acting career, before becoming one of the founders of the Group Theatre in 1931, directing a number of plays there.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Michael V. Gazzo', '1923-04-05', 'Hillside, New Jersey, USA', 'nm0311155', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTY0NTkwNDYxNl5BMl5BanBnXkFtZTcwMDc1ODcwOA@@._V1_.jpg', 'Michael Vincente Gazzo was born in Hillside, New Jersey, on April 5, 1923. He attended Erwin Piscator\'s Dramatic Workshop at the New School on the GI Bill after being demobilized from the US Army Air Force after World War II.Gazzo\'s first major success was as a playwright.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('G.D. Spradlin', '1920-08-31', 'Pauls Valley, Oklahoma, USA', 'nm0819525', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTY2NjM5ODQyMF5BMl5BanBnXkFtZTcwNjgzOTIxNg@@._V1_.jpg', 'G.D. Spradlin started his career as a lawyer, then became an Independent Oil producer. He was active in local politics before turning to acting. He joined the Oklahoma Repertory Theatre in 1964.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Richard Bright', '1937-06-28', 'Brooklyn, New York, USA', 'nm0109175', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Fair complexioned, cold-eyed actor Richard Bright has notched up an impressive array of character performances of often shifty, or deadly characters on the wrong side of the law. First came to attention as a burglar in the engrossing "The Panic in Needle Park", and then followed it the following year playing a slick con artist hustling naive Ali MacGraw for the bank robbery loot in "The Getaway", before Steve McQueen pummels Bright to get the money back.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Gastone Moschin', '1929-06-08', 'San Giovanni Lupatoto, Veneto, Italy', 'nm0608311', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Tom Rosqui', '1928-06-12', 'Oakland, California, USA', 'nm0743159', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'American character actor with extensive stage experience. Born in Oakland, California, he appeared on Broadway in "Sticks and Bones," and "The Price," among others. He acted often in television, but his most prominent role was as Corleone family bodyguard Rocco Lampone in the first two \'Godfather\' movies.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Bruno Kirby', '1949-04-28', 'New York City, New York, USA', 'nm0456124', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTI4NTQ4NTU0OV5BMl5BanBnXkFtZTcwNTA2MDAxMw@@._V1_.jpg', 'Native New Yorker and Italianate Bruno Kirby tended towards assertive, pushy, streetwise characters and was armed with a highly distinctive scratchy tenor voice that complemented his slim eyes and droopy puss and accentuated his deadpan comedic instincts on film and TV.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Frank Sivero', '1952-01-06', 'Agrigento, Sicily, Italy', 'nm0803370', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTkzNDQxMTcxMF5BMl5BanBnXkFtZTcwNTU0NDgyMQ@@._V1_.jpg', 'Frank Sivero (born January 6, 1952) is an American character actor, perhaps best known for playing the roles of Genco Abbandando in Mario Puzo\'s and Francis Ford Coppola\'s The Godfather Part II and Frankie Carbone (based on Angelo Sepe) in Martin Scorsese\'s Goodfellas.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Francesca De Sapio', 'Unknown', '', 'nm0211495', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk2MTc1NjYzNF5BMl5BanBnXkFtZTgwMjMxNDE4NTE@._V1_.jpg', 'Born in Rome, Italy. After completing her undergraduate studies in 1965, she moved to United States. Became a member of the Actor\'s Studio in 1969. Began her movie career and worked with Al Pacino and Arthur Penn. In 1985 she founded the "Duse Studio" with Giuseppe Perruccio.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Morgana King', '1930-06-04', 'Pleasantville, New York, USA', 'nm0455088', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Marianna Hill', '1942-02-09', 'Santa Barbara, California, USA', 'nm0384494', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjE4MTc3NTEzOF5BMl5BanBnXkFtZTcwMzIzMDU4Mg@@._V1_.jpg', 'A familiar character actress, Mariana Hill was the daughter of a building contractor, who moved his family around. In addition to living in her native Southern California, Hill has lived in Canada, Spain and Great Britain. As a result, she learned and became quite accomplished in doing different accents and dialects.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Leopoldo Trieste', '1917-05-03', 'Reggio Calabria, Calabria, Italy', 'nm0872689', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Dominic Chianese', '1931-02-24', 'Bronx, New York City, New York, USA', 'nm0156940', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk4Njk4MzgyNF5BMl5BanBnXkFtZTcwMzM0NDk4Mw@@._V1_.jpg', 'A multi-talented performer--as well as being an actor, he is an accomplished singer. He released a new music CD in late 2000 on which he sings American and Italian standards.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Amerigo Tot', '1909-09-27', 'Fehérvárcsurgó, Austria-Hungary [now Hungary]', 'nm0869293', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Troy Donahue', '1936-01-27', 'New York City, New York, USA', 'nm0001148', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTg2MTk2ODE5MV5BMl5BanBnXkFtZTYwMTAwMDM2._V1_.jpg', 'Troy Donahue was a journalism student at Columbia University when he began playing in stock productions. He made his film debut in "Man Afraid" and in 1959 signed as a contract player with Warner Bros., which promoted him to stardom with "A Summer Place" that year.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('John Aprea', '1941-03-04', 'Englewood, New Jersey, USA', 'nm0032501', 'https://images-na.ssl-images-amazon.com/images/M/MV5BODgxMTA1NTI1MF5BMl5BanBnXkFtZTgwNDYxNTQxMDE@._V1_.jpg', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Joe Spinell', '1936-10-28', 'New York City, New York, USA', 'nm0818874', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjAxMDk2MDE2NF5BMl5BanBnXkFtZTcwMzM2NzE5Mw@@._V1_.jpg', 'Joseph J. Spagnuolo was born on October 28, 1936 in Manhattan, New York City at his family\'s apartment on 2nd Avenue. Spinell was a tough guy on and off screen all his life. During his teen years, while still in high school, he acted in various plays on the New York stage, on and off Broadway, eventually earning a place in Joe Papp\'s Shakespeare Festival Theater.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('James Caan', '1940-03-26', 'The Bronx, New York, USA', 'nm0001001', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTI5NjkyNDQ3NV5BMl5BanBnXkFtZTcwNjY5NTQ0Mw@@._V1_.jpg', 'A masculine and enigmatic actor whose life and movie career have had more ups and downs than the average rollercoaster and whose selection of roles has arguably derailed him from achieving true superstar status, James Caan is New York-born and bred.He was born in the Bronx, to Sophie (Falkenstein) and Arthur Caan, Jewish immigrants from Germany.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Abe Vigoda', '1921-02-24', 'Brooklyn, New York City, New York, USA', 'nm0001820', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjE1MDk5NzMyN15BMl5BanBnXkFtZTYwMjA4Mjg1._V1_.jpg', 'Tall, dour-faced and slouch-shouldered character actor Abe Vigoda proved himself in both gritty dramatic roles, and as an actor with wonderful comedic timing.Vigoda was born in Brooklyn, New York, to Lena (Moses) and Samuel Vigoda, both Russian Jewish immigrants.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Tere Livrano', 'Unknown', '', 'nm0515372', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Gianni Russo', '1943-12-12', 'Manhattan, New York City, New York, USA', 'nm0751625', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTgyMTgxODM4MV5BMl5BanBnXkFtZTcwNDg5NDYwOA@@._V1_.jpg', 'With a singularly nebulous background, which, by his account, included stints as a Las Vegas nightclub emcee, radio personality and jewelry tycoon, and with comparatively little acting experience, Gianni Russo won the role of Carlo Rizzi in "The Godfather" on the basis of his screen test.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Maria Carta', '1934-06-24', 'Siligo, Sardinia, Italy', 'nm0141404', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ3Mjc4Njk5OV5BMl5BanBnXkFtZTgwODk3NjIwMjE@._V1_.jpg', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Oreste Baldini', 'Unknown', 'Milan, Lombardy, Italy', 'nm0049764', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjI2OTMzMTA2NF5BMl5BanBnXkFtZTgwNDg3NjIwMjE@._V1_.jpg', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Francis Ford Coppola', '1939-04-07', 'Detroit, Michigan, USA', 'nm0000338', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTM5NDU3OTgyNV5BMl5BanBnXkFtZTcwMzQxODA0NA@@._V1_.jpg', 'Francis Ford Coppola was born in 1939 in Detroit, Michigan, but grew up in a New York suburb in a creative, supportive Italian-American family. His father, Carmine Coppola, was a composer and musician. His mother, Italia Coppola (née Pennino), had been an actress.');
