INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Robert Evans', '1930-06-29', 'New York City, New York, USA', 'nm0263172', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTMxODYyNjg5N15BMl5BanBnXkFtZTYwMzY0ODk1._V1_.jpg', 'Raised on Manhattan\'s Upper West Side (his father was a dentist with a thriving practice in Harlem), Evans began his show-business career as a teenage radio act or. After flopping in his first attempt at movie acting, he took a job promoting sales of ladies\' slacks for Evan-Picone, the clothing company founded and run by his brother.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Nino Rota', '1911-12-03', 'Milan, Lombardy, Italy', 'nm0000065', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNjk3NTE2OTA2OV5BMl5BanBnXkFtZTcwMDE2MTcyMQ@@._V1_.jpg', 'Born in Milan in 1911 into a family of musicians, Nino Rota was first a student of Orefice and Pizzetti. Then, still a child, he moved to Rome where he completed his studies at the Conservatory of Santa Cecilia in 1929 with Alfredo Casella. In the meantime, he had become an \'enfant prodige\', famous both as a composer and as an orchestra conductor.');
