INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('John Dapper', 'Unknown', '', 'nm0200859', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'John Dapper (born December 8, 1923 in Huntington Park, California) has worked as a scenic designer and art director on dozens of classic films, numerous television episodes, and blockbuster theatrical productions on Broadway.As a young man, Dapper took courses in architecture and design at the University of California, Los Angeles, and the University of Southern California.');
