INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Walter Murch', '1943-07-12', 'New York City, New York, USA', 'nm0004555', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Walter Murch has been editing sound in Hollywood since starting on Francis Ford Coppola\'s film "The Rain People". He edited sound on "American Graffiti" and "The Godfather: Part II", won his first Academy Award nomination for "The Conversation", won his first Oscar for "Apocalypse Now", and won an unprecedented double Oscar for Best Sound and Best Film Editing for his work on "The English Patient".');
