INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Jesse Wayne', '1941-09-14', 'Los Angeles, California, USA', 'nm0915586', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTc2NTY1ODg0OF5BMl5BanBnXkFtZTcwODM0MzEzMQ@@._V1_.jpg', 'Jesse Wayne appeared in over 500 TV productions and feature films, in addition to hundreds of live stunt shows. If this seems like a lot, it\'s because his career began in the early days of Los Angeles\' live television, when he was eight years old.In 1959, his diminutive 5\' 4" stature enabled him to become Mickey Rooney\'s stunt double at MGM.');
