INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Carmine Coppola', '1910-06-11', 'New York City, New York, USA', 'nm0178874', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjk1MTY2MjA5OF5BMl5BanBnXkFtZTgwODYxNTcxMDE@._V1_.jpg', 'Composer, conductor, arranger and flautist, educated at the Manhattan School of Music (BA, MA) and Juilliard (on scholarship) (MM). He was first flautist for Radio City Music Hall from 1934 to 1936, the Detroit Symphony from 1936 to 1941, the NBC Toscanini Orchestra from 1942 to 1948 and staff arranger for Radio City Music Hall from 1948 to 1956, and the opera conductor for the Brooklyn Academy of Music from 1948 to 1955.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Carmine Coppola', '1910-06-11', 'New York City, New York, USA', 'nm0178874', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjk1MTY2MjA5OF5BMl5BanBnXkFtZTgwODYxNTcxMDE@._V1_.jpg', 'Composer, conductor, arranger and flautist, educated at the Manhattan School of Music (BA, MA) and Juilliard (on scholarship) (MM). He was first flautist for Radio City Music Hall from 1934 to 1936, the Detroit Symphony from 1936 to 1941, the NBC Toscanini Orchestra from 1942 to 1948 and staff arranger for Radio City Music Hall from 1948 to 1956, and the opera conductor for the Brooklyn Academy of Music from 1948 to 1955.');
